    def dailyTemperatures(self, temperatures):
        """
        :type temperatures: List[int]
        :rtype: List[int]
        """
        result_list = [0 for i in range(len(temperatures))]
        uncertain = {}
        for i in range(len(temperatures)):
            temperature = temperatures[i]
            delete_list = []
            for k, v in uncertain.items():
                if temperature > k:
                    for j in uncertain[k]:
                        result_list[j] = i - j
                    delete_list.append(k)
            for key in delete_list:
                del uncertain[key]
            if temperature in uncertain:
                uncertain[temperature].append(i)
            else:
                uncertain[temperature] = [i]
        return result_list


